import React, { Component } from 'react';

class Products extends Component {
    render() {
        return (
            <div className="col-4">
  <div className="card text-left">
    <img className="card-img-top" src="https://static.nike.com/a/images/t_prod_ss/w_960,c_limit,f_auto/8841087a-0fab-4986-892a-b3fc71178ecd/air-max-90-duck-camo-release-date.jpg" alt="" />
    <div className="card-body">
        <h5 className="card-title float-left">{this.props.ProductName}</h5>
      <h5 className="card-title float-right">200.00$</h5>
    </div>
  </div>
</div>
        );
    }
}

export default Products;
